import { Table } from 'antd';

const { Column, ColumnGroup } = Table;

const data = [
  {
    key: '1',
  }
];

const App = () => (
  <Table dataSource={data} pagination={false}>
    <ColumnGroup title="Padrão">
      <Column title="F/mm" dataIndex="fmm" key="fmm" />
      <Column title="Unidades" dataIndex="unidades" key="unidades" />
    </ColumnGroup>
    <ColumnGroup title="Fim da Proteção de Molde">
      <Column title="Força" dataIndex="forca1" key="forca1" />
      <Column title="Ponto" dataIndex="ponto1" key="ponto1" />
    </ColumnGroup>
    <ColumnGroup title="Pressão de Proteção de Molde">
      <Column title="Força" dataIndex="forca2" key="forca2" />
      <Column title="Ponto" dataIndex="ponto2" key="ponto2" />
    </ColumnGroup>
    <Column title="" dataIndex="" key="valores" render={() => (
      <>
        <Table dataSource={[{key: '1', v1: 900, v2: 0.5, v3: 14, v4: 55}]} pagination={false}>
          <Column title="" dataIndex="v1" key="v1" />
          <Column title="" dataIndex="v2" key="v2" />
          <Column title="" dataIndex="v3" key="v3" />
          <Column title="" dataIndex="v4" key="v4" />
        </Table>
      </>
    )} />
  </Table>
);

export default App;
